import React from 'react';
import './AboutMe.css';

function AboutMe(props) {
    return(
        <div className = "about">
            <p>Hi my name is Richard Murray and I would like to help you with all the projects your husband says he will do but hasn't gotten to it yet. I will help you husbands finish projects so you can surprise your wife. I will help all those that need help with finishing touches on their houses. I have been construction fo 20 plus years. I had a contracting company but couldn't continue with it because of health reasons but I am getting back into it and wanting to help everyone with their finishing projects.</p>
        </div>
    )
}

export default AboutMe;
